import collections
import heapq
import functools


class Solution:
    def removeDuplicates(self, s: str, k: int) -> str:
        didPreviousChange = True
        isIncluded = [True for _ in range(len(s))]

        counter = {}

        while didPreviousChange:
            didPreviousChange = False
            q = []
            counter = {}
            for i in range(len(s)):
                if not isIncluded[i]:
                    continue
                else:
                    if len(q) == k:
                        counter[s[q[0]]] -= 1
                        if counter[s[q[0]]] == 0:
                            del counter[s[q[0]]]
                        q.pop(0)

                    q.append(i)
                    if s[i] not in counter:
                        counter[s[i]] = 0
                    counter[s[i]] += 1

                    if len(q) == k and len(counter) == 1:
                        for j in q:
                            isIncluded[j] = False
                        q = []
                        counter = {}
                        didPreviousChange = True

        ans = ""
        for i in range(len(s)):
            if isIncluded[i]:
                ans += s[i]

        return ans

    def removeDuplicates(self, s: str, k: int) -> str:
        stack = []
        for index, char in enumerate(s):
            if len(stack) == 0:
                stack.append([char, 1])
                continue
            top = stack[-1]
            if char == top[0]:
                top[1] += 1
                if top[1] == k:
                    stack.pop()
            else:
                stack.append([char, 1])

        ans = ""
        for char, count in stack:
            for _ in range(count):
                ans += char

        return ans




if __name__ == '__main__':
    print(Solution().removeDuplicates(s = "deeedbbcccbdaa", k = 3))
    print(Solution().removeDuplicates(s = "pbbcggttciiippooaais", k = 2))
    print(Solution().removeDuplicates("", 2))
